import React, { useEffect, useState } from "react";
import Header from "../../components/Header";

const Dashboard = () => {
  const [stats, setStats] = useState({
    inquiries: 0,
    admissions: 0,
    users: 0,
    revenue: 0,
  });

  const [loading, setLoading] = useState(true);
  

useEffect(() => {
  fetch("http://localhost:5000/api/dashboard/stats")
    .then((res) => res.json())
    .then((data) => {
      setStats(data);
      setLoading(false);
    })
    .catch((err) => {
      console.error("‚ùå Error fetching dashboard stats:", err);
      setLoading(false);
    });
}, []);


  return (
    <div className="page">
      {/* Internal CSS */}
      <style>{`
        .page {
          padding: 20px;
          font-family: "Segoe UI", Roboto, Arial, sans-serif;
          background: #f9fafc;
          min-height: 100vh;
        }

        .stats {
          display: grid;
          grid-template-columns: repeat(auto-fit, minmax(220px, 1fr));
          gap: 20px;
          margin-bottom: 30px;
        }

        .card {
          background: #fff;
          padding: 20px;
          border-radius: 12px;
          box-shadow: 0 3px 10px rgba(0, 0, 0, 0.08);
          font-size: 18px;
          font-weight: 500;
          color: #374151;
          transition: transform 0.2s ease, box-shadow 0.2s ease;
        }

        .card:hover {
          transform: translateY(-4px);
          box-shadow: 0 6px 16px rgba(0, 0, 0, 0.12);
        }

        .charts {
          display: grid;
          grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
          gap: 20px;
          margin-bottom: 30px;
        }

        .chart {
          background: #fff;
          padding: 20px;
          border-radius: 12px;
          box-shadow: 0 3px 10px rgba(0, 0, 0, 0.08);
        }

        .chart h3 {
          margin-bottom: 10px;
          font-size: 16px;
          color: #4f46e5;
        }

        .recent {
          background: #fff;
          padding: 20px;
          border-radius: 12px;
          box-shadow: 0 3px 10px rgba(0, 0, 0, 0.08);
        }

        .recent h3 {
          margin-bottom: 15px;
          font-size: 18px;
          color: #4f46e5;
        }

        .recent ul {
          list-style: none;
          padding: 0;
          margin: 0;
        }

        .recent li {
          padding: 8px 0;
          border-bottom: 1px solid #e5e7eb;
          font-size: 15px;
          color: #374151;
        }

        .recent li:last-child {
          border-bottom: none;
        }
      `}</style>

      <Header title="üìä Dashboard" />

      {/* <div className="stats">
        <div className="card">Total Inquiries: {stats.inquiries}</div>
        <div className="card">Total Admissions: {stats.admissions}</div>
        <div className="card">Total Users: {stats.users}</div>
        <div className="card">Total Revenue: ‚Çπ{stats.revenue}</div>
      </div> */}

      {loading ? (
  <p>Loading stats...</p>
) : (
  <div className="stats">
    <div className="card">Total Inquiries: {stats.inquiries}</div>
    <div className="card">Total Admissions: {stats.admissions}</div>
    <div className="card">Total Users: {stats.users}</div>
    <div className="card">Total Revenue: ‚Çπ{stats.revenue}</div>
  </div>
)}


      <div className="charts">
        <div className="chart">
          <h3>Inquiries Trend (Monthly)</h3>
          <p>[üìà Chart Placeholder]</p>
        </div>
        <div className="chart">
          <h3>Conversion Funnel</h3>
          <p>[üîÑ Funnel Placeholder]</p>
        </div>
        <div className="chart">
          <h3>Revenue Chart</h3>
          <p>[üí∞ Revenue Graph Placeholder]</p>
        </div>
      </div>

      <div className="recent">
        <h3>Recent Activities</h3>
        <ul>
          <li>üì© Inquiry from John Doe</li>
          <li>üí∞ Payment from Priya Sharma</li>
          <li>üéì Admission confirmed for Ramesh</li>
        </ul>
      </div>
    </div>
  );
};

export default Dashboard;
